import React from "react";
import ReactDOM from "react-dom";
// import App from './App'

function Card() {
  return (
    <>
      <div className="cards">
        <div className="card">
          <img 
              src="https://upload.wikimedia.org/wikipedia/en/d/da/DarkNetflixPosterEnglish.jpg" 
              alt="mypic" 
              className="card__img" />
            <div className="card__info">
            <span className="card__category">  A Netflix Original Series </span>
            <h3></h3>
            <a 
            href="https://www.netflix.com/in/title/80100172" 
            target="_blank" >
              <button> Watch Now</button>
            </a>
          </div>
        </div>
      </div>
    </>
  );
}

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <>
    <Card />
    <Card />
    <Card />
    <Card />
  </>
);
